@AndyPet77714017 @DrFrancesRyan **HOW VACCINES WORK**

Vaccination lessens the chance that you, and others you encounter, will end up either dead or with long #COVID.

Analogy: getting the flu jab every year doesn't mean you won't get the flu. It means if you do, your flu will be milder, and won't kill you.

